title: "Handmade leather bags & totes hand stitched in New York",
announcement: "20% of all travel bags. Use coupon code TravelBag at check out in all caps. Welcome to my handmade leather shop. Rules apply. All leather totes, messengers, travel bags, and duffles made and designed completely by hand in the New York city USA. Every single leather item is hand cut, hand punched and hand stitched. My leather goods are machine free, robot free, electricity free completely human produced!!!!! Low carbon footprint. Stop by my Facebook page https://www.facebook.com/lusciousleathernyc/?pnref=lhc Thank you for stopping by my Etsy shop. I am a self taught leather smith working with leather since 1999 selling in soho as a street vendor since 2001, by Balthazar restaurant in Soho in New York city. (no where else ; )) Leather is my mission and calling. Let me know what my leather and I can do for you! I joined Etsy last year, but I set up my shop on January 30th 2011. Feel free to contact me anytime, Don&#39;t see exactly what you are looking for? We do custom! Thank you for stopping by! Due to a lost package I am now encouraging everyone to get insurance. We cannot be held responsible for lost or stolen items in the mail. USPS takes only responsibility over insured items. SIZING If you do not know if your lap top will fit please contact us. We suggest you go two inches up than the size of your biggest item. For 11 inch lap tops get 13 inch For 13 inch lap tops get 15 inch For 15 inch lap tops get 17 inch as so on. Coupon Rules Not valid on alligator, moose, lamb, Italian leathers. Not valid on custom listings, law away or bulk orders. Not valid on items that say sale, or cannot be purchased with coupon code Not valid on past orders. Coupons are limited time only. DEAR INTERNATIONAL BUYERS On January 27th the shipping to International countried greatly increased almost 10 dollars for every flat rate package. Please bare with me and I adjust my prices accordingly on the site. If for some reason you bought something after January 27th and I had not gotten a chance to update my prices it will go first class mail. USPS is the cheapest way to send it, and flat rate is the largest box that I can use to fit the most in. Please be aware that I will try to squeeze something inside in order to save you 10 or 15 dollars! All the leather is natural and once used and filled up will function normally. This is the cheapest way I know how to ship. If you want me to cheapest any other way please contact me, just know that any differences will be at our expense. DEAR AUSTRALIAN BUYERS! Thank u so much for orders. Please be aware that packages are taking an extraordinarily amount of time, at times perhaps one month. I dont understand what it taking so long, and I am not sure what I can do to change it. I am vey sorry about that, but I am not responsible for the shipping times and or custom delays. Thank u so much.",
currency_code: "USD",
is_vacation: false,
vacation_message: null,
sale_message: "Thank you very much for buying my hand made item. Please note I make each item by hand one by one. And I go through every effort to make sure it&#39;s the best that I can make. So please don&#39;t be upset if it&#39;s late a day or 2 I am just giving it extra love. Please be aware that as of Nov1st there is a a minimum of 2 week lead time due to high volume of sales through etsy and local new yorkers. If this is an urgent order or you have a deadline to meet please let me know immediately. You also have the option to pay for over night shipping. If you are an out of USA order contact me if you want insurance or expedited shipping. Thank you again for buying hand made and hand stitched by a human not a machine. Have a great day and I deeply and sincerely appreciate your order and hope that if you love it you will give me feedback on etsy as it&#39;s really important to me and my work. And if you are unhappy for any reason you contact me directly and I will try my hardest to resolve it. Thank u again. I love leather. I love how it smells, how it feels in my hand, how the thread goes through the needle, and how the needle punctures the leather. My work relationship with leather started accidentally when someone sold me a box of leather remnants in a flea market in 1998 for 20 dollars. I brought it home and made miniature purses and boots out of it, sewing and gluing them onto cards. From the cards I went on to make leather journals and from there, the satchels, the bags, and the belts. The elation it brought me made me quit my job as a school director and pursue &quot;leather&quot; full time. Infatuation with leather did not start there. My first real leather belt came from and NYU craft show, where the leather smith made me a custom belt. The rhythmic pounding of his hammer on his wooden table created music through the leaves and the trees. The breeze... shook me, the power of creation had echoed in me. I wore the belt almost every day, hearing the echo, for 10 years. Of the few things that made it back home after two and half years were my first real leather shoes, which I wore in the heat of summer and the dead of winter. The more I walked in them the better they felt. The belt and shoes are long gone, they were stolen out of my car in a parking garage in N.Y.C., but the feeling of good strong quality leather, as something that grows with you, stays with me. This and other memories came to me as I cut my first bag, sewed my first pieces, without any schooling or training in leather, just hearing the echo. Creating a multidimensional functional piece with pockets, closures, hidden compartments, secret places out of something flat and languid makes me smile, and gives me a high every single time. Leather is my calling. DEAR INTERNATINAL BUYERS On January 27th the shipping to International countried greatly increased almost 10 dollars for every flat rate package. Please bare with me and I adjust my prices accordingly on the site. If for some reason you bought something after January 27th and I had not gotten a chance to update my prices it will go first class mail. USPS is the cheapest way to send it, and flat rate is the largest box that I can use to fit the most in. Please be aware that I will try to squeeze something inside in order to save you 10 or 15 dollars! All the leather is natural and once used and filled up will function normally. This is the cheapest way I know how to ship. If you want me to cheapest any other way please contact me, just know that any differences will be at our expense. DEAR AUSTRALIAN BUYERS! Thank u so much for orders. Please be aware that packages are taking an extraordinarily amount of time, at times perhaps one month. I dont understand what it taking so long, and I am not sure what I can do to change it. I am vey sorry about that, but I am not responsible for the shipping times and or custom delays. Thank u so much. SIZING If you do not know if your lap top will fit please contact us. We suggest you go two inches up than the size of your biggest item. For 11 inch lap tops get 13 inch For 13 inch lap tops get 15 inch For 15 inch lap tops get 17 inch as so on. FEEDBACK Feedback is really important to me its is my life blood it is my morning coffee it is like a tip in the jar of the person in your coffee shop these are my darlings my lovies my creations this is how to http://www.etsy.com/help/article/102?ref=help_search_result thank u",
