title: "A5 Leather Side Opening Note Book Holder. Personalized, 2 inside pockets, buckle & recycled Cocoa Paper note book.",
description: "Beautiful genuine leather cover to fit any A5 side opening spiral bound note book. The folio comes complete with 2 pockets to hold all your papers, a pen holder and secure buckle closure. Different colors are available. Both the folio and note book are customizable. Available in a range of colors and includes the note book. PadFolio / Leather Cover: - Leather Cover size approx: 17.5cm x 23.5cm / 6.9&quot; x 9.2&quot; / A5. - Designed to fit a A5 Note Book 14.8cm x 21.0cm (5.8&quot; x 8.2&quot;) but will fit up to 16cm x 23cm (6.29&quot; x 9.05&quot;) - Genuine Sheep Leather with 2 inside pockets, pen holder and stylish buckle closure - Available in a range of colours. - Leather may be laser etched with your chosen design from our design gallery, your name, logo or left plain. Note Book: - Includes a 40 page Cocoa Paper spiral bound note book. - Note Book size: 15cm x 21cm / 5.9&quot; x 8.27&quot; - Printed in your chosen design and chosen color. - White wire spirals. - Made entirely by hand upon ordering. ★ Please Include in “notes to Cocoa Paper”at checkout: 1- The name, initials or Monogram for engraving (NB: Monogram is: First, Last, Middle initials). 2- Font number of your choice, see photo for options. 3- Contact phone number in case the shipping company needs to contact you. ☆ Without laser engraving instructions we are unable to complete your order. We will try and contact you via Etsy Convo however this may delay the shipment of your order. ☆ An artwork proof will be sent to your Etsy inbox for your approval so please look out for this. Please check spelling & punctuation carefully as errors cannot be refunded or rectified. ---------------------------------------------------------------------------------------------------- ☆ Have a business logo or have a particular design you like? Please message us and attach an image of your logo before purchasing to be sure your design is suitable. ☆ See our Standard A5 PadFolio here:: https://www.etsy.com/shop/CocoaPaper?section_id=16117424&ref=shopsection_leftnav_2 ☆ See our A4 Pad Folio&#39;s here: https://www.etsy.com/shop/CocoaPaper?section_id=16117422&ref=shopsection_leftnav_1 ☆ The laser color will be the natural underside of the leather and is variable between colors, dye lots and device monitors. Due to the handmade nature of the leather, colors may vary slightly. ☆ Left Handed? No problem, just let us know. ☆ Our PadFolio&#39;s are made to flex slightly & are lightly padded with a sponge lining for a beautiful soft feel. ☆ Please read our shop policies and check production times before ordering (shipping & policies tab). Pen, cards and accessories not included. This listing is for one note book and one leather note book cover. Our handmade leather pad folio&#39;s are produced to the highest quality in &quot;smallholder&quot; production systems employing local people and particularly women. Our sustainable handmade Cocoa Paper and Cocoa Cardboard is made from waste cocoa tree bark without using harsh chemicals.",
