announcement: "● Dear Customers, We have been experiencing major delays with EMS shipping however this has now been resolved for the majority of those affected. We&#39;ve also put systems in place with EMS management to prevent issues like this happening again. Thank you for your patience during this time! ● ❤ Beautiful handmade cocoa paper stationery, leather PadFolio&#39;s and other goods made from natural cocoa tree bark. ❤ Cocoa Paper is a handmade recycled paper made using the waste bark from cocoa trees (the trees that bring you chocolate!). We purchase waste cocoa tree bark from Sulawesi, Indonesia which provides an additional income to women living in cocoa farms. All our products are handmade to order by a talented team of artisans in Bali that creates employment opportunities. ● ❀ ┅ ❀ ● worldwide shipping ● ❀ ┅ ❀ ● Find something you like but want to customize it to suit your needs...no problem just send us a message. Wholesale orders are welcome so please message us with your inquiry. PLEASE, READ OUR SHOP POLICIES AND LISTING DETAILS BEFORE MAKING YOUR PURCHASE. Like us on Facebook @ https://www.facebook.com/CocoaPaper to stay updated on sales, specials and new products. Please check out our sister business www.cocoacare.org for more ways to help cocoa farming families. xoxo Facebook: https://www.facebook.com/CocoaPaper Twitter: https://twitter.com/ecocsi",
