description: "&gt;&gt;&gt;&gt;&gt;FREE SHIPPING ON ALL ORDERS WITHIN THE UNITED STATES!!&lt;&lt;&lt;&lt;&lt; Need a shipping upgrade so your item can be delivered even more quickly? Please contact us! Check out our REDUCED international shipping rates as well. &gt;&gt;&gt;&gt;&gt;Free customization for these journals! &lt;&lt;&lt;&lt;&lt; Handmade and hand printed 100% cowhide journal/sketchbook cover with refillable book inside, custom-made specifically for you! Keep reading for tons of information on customization and item specs... We can add up to 10 words in our American Typewriter Font (letters are hand-stamped individually with our in-studio letter set, so we only have one size and style of font available). Because of space limitations, we will choose the most suitable and attractive text layout for the item, but please let us know if you have any general preferences for your custom text placement. Please let us know what text to add in the “Notes to Seller” section of the etsy checkout process. We print in solvent, fade-free black ink. Want a different image? For no extra charge, you can choose from our 3000+ image options. Please contact us for more information on viewing your image options, and make sure to browse through our shop listings for readily available images. If you know which of our available images you want and what text you want to add, please let us know in the “Notes to Seller” section of the etsy checkout specifically what you want printed on the item! &gt;&gt;&gt;Filler book specs:&lt;&lt;&lt; -4 in x 6 in book -65 lb weight paper -acid free -off white -110 pages (220 front and back) &gt;&gt;&gt;Free Customization Options and Information:&lt;&lt;&lt; -choose from any of our 3000+ available images (contact us for link to site with image options) -add up to 10 words anywhere there is room on the journal in our American Typewriter font (only one size of text is available, please check out our shop for tons of examples of our letter set on items) -choose from our available leather colors (options available at checkout) ***We can only print in black ink*** - In some cases during the months of January-October, we can recreate an image sent to us for an upcharge. In order to recreate any image sent to us for your item, we would need to either hand cut a stencil or have a stamp custom made for you. Either of these options are not in our normal processes, and will require more time, an upcharge, and a custom listing. These services are not available during the months of November or December. Please contact us for more information regarding these options. -Mock ups on paper can be provided for your custom order for a $3-5 upcharge depending on the amount of text involved, please contact us for more information. &gt;&gt;&gt;Process:&lt;&lt;&lt; We use stamps and stencils to print on these with an ink that is specific to leather. It generally takes 3-5 business days to create each item before it can ship. If you would like expedited shipping for a small fee, let us know over etsy and we can talk more about your deadlines. &gt;&gt;&gt;Shipping:&lt;&lt;&lt; Items ship from the United States to any country in the world via USPS priority and first class mail. Items shipped within the United States take an average of 2-3 business days once they have been shipped to arrive. Items shipping outside of the United States take an average of 6-10 business days to arrive, pending customs delays. Tracking will be provided with every package, but cannot be guaranteed to be updated once a package has left the United States. We are not responsible for duties or taxes/other fees incurred on your package outside of the United States, please familiarize yourself with your countries policies on international packages. Express mail is available for extra cost both domestically and internationally, please contact us over etsy for more information! &gt;&gt;&gt;Wholesale:&lt;&lt;&lt; We love our 275+ wholesale accounts, and would love to add your store to our roster. Please contact us for more information. Thanks so much- please contact us over etsy for any questions, we love to hear from you! :)",
