announcement: "Thanks for shopping handmade! Announcing free shipping within the USA on all items! Need a shipping upgrade, or your item delivered even more quickly? Contact us! Check out our reduced international shipping rates as well! Colors listed in drop down menu at checkout are the only colors available for the item listed. Almost all items are available for custom order! Check the listing description of the item you like for more guidelines. We allow 5 business days to make and ship most items, such as journals, flasks, and wallets. Larger items, like bags and guitar straps, take 1-2 weeks of production time. Shipping TYPICALLY takes 3 business within the US and 6-10 business days internationally (barring any customs issues). We ship primarily via USPS Priority Mail and provide tracking numbers for each order shipped. We use USPS First Class shipping for some smaller items (check item descriptions for details). We are not responsible for product loss due to customs issues. Please also check out our shop Policies section for additional information. Contact us over etsy for more information or any questions. &quot;Like&quot; us on Facebook and we&#39;ll keep you updated with all our new products and designs! http://www.facebook.com/inbluehandmade Follow us on twitter and instagram @inbluehandmade Want special promo codes, insight on new products to come, and pictures of really cute dogs in hats? Sign up for our mailing list! http://eepurl.com/bEgAEn SOME AMAZING ETSY ARTISTS.... Asheville Represent! www.holdfastoutfitters.etsy.com Check out awesome local Asheville artist Catalina Dibiase at www.catalinasilks.etsy.com Check out Emily Kircher&#39;s etsy site at www.ekra.etsy.com Thanks so much and happy shopping!",
