vacation_message: "Hello Everyone! We are vending Pitchfork Music Festival in Chicago this week, and off to Floyd Fest in Virginia and Newport Folk Festival in Rhode Island next week! We are our on the road in the middle of our indie craft tour 2014! Our shop has taken a short break from July 14th - July 23rd so we can focus on these events. We will be checking our etsy while we are gone, so please do not hesitate to contact us for more information. Shipping on all items will resume on July 29th. Thank you so much, happy festival season! ",
sale_message: "All items ship within the USA for no extra charge. Most ship first class USPS or Priority USPS&gt; Please let us know if you need your item more quickly, and we can set you up with a shipping upgrade. All items outside of the USA will include shipping fees at checkout. Please let me know if you have any questions about your shipping schedule. Most items take 3-5 business days to produce before they are shipped. Bags have a production time of 1-2 weeks. If you have any problems at all, please etsy convo us and we&#39;ll get right back to you. Please remember to leave positive feedback for your item! Thank you again so much! :) want special promo codes, insight on new products to come, & pictures of really cute dogs in hats? Sign up for our mailing list! http://eepurl.com/bEgAEn &#39;Like&#39; us on facebook : www.facebook.com/inbluehandmade Follow us on Instagram and Twitter! : @inbluehandmade ************************ATTENTION U.S. CUSTOMERS******************************** If you have ordered a bag from In Blue, Insurance and Signature confirmation has are included! This ensures that your bag is covered if lost, or there is a problem with delivery. The added cost for these two items is $5 to the shipping, and this is currently only if you have ordered a bag. *************************ATTENTION U.K. CUSTOMERS******************************* Customs Duty, Excise Duty and import VAT: basics If you&#39;re ordering goods from abroad, or buying and sending to the UK goods from abroad for personal use, you may have to pay Customs Duty, Excise Duty or import VAT. Paying tax and/or duty when goods have arrived in the UK: For any type of purchased goods posted to the UK from outside the EU, import taxes and/or duty are payable BY THE RECEIVER before delivery once the goods have arrived in the UK. The amount due is worked out based on the information shown on the Customs Declaration fixed to the package. More information on Customs Duty, Excise Duty or import VAT can be found here at gov.uk: https://www.gov.uk/browse/business/imports-exports In Blue Shipping and general shop policies can be found here: https://www.etsy.com/shop/inblue/policy?ref=shopinfo_policies_leftnav",
