policy_payment: "I accept PayPal as secure payment. Paypal accepts all major credit cards. I also accept Direct Checkout through Etsy, which accepts all major credit cards, and Etsy Gift Cards. The Credit Card customers do not need a paypal account to pay via paypal. Just click the payment button and you have the option to pay with a credit card without signing up for paypal. In any case of payment method, the shipping is made after the amount appear in the Esty account, or in the PayPal account. If payment is not received within 2 days, the order will be canceled.",
policy_shipping: "Each product is ready for shipment in 1-2 days after payment is received. I will ship from Hungary with FEDEX priority worldwide, or with DPD in neighboring countries, with tracking number. In each case I need your PHONE NUMBER, for the delivery. If Etsy and PayPal show two different addresses, automaticly I will ship your package to the Etsy address, so please make sure it&#39;s correct! Usually the shipping times takes 3-4 working day. Every item will be sent registered, and insured in bubble foil packets or/and carton box. Any kind of duty, is the customer obligation. Thanks for understanding! ",
policy_refunds: "If you are unhappy with your order for any reason, please contact me within 3 working days of receiving your package. I will do my best to resolve the problem quickly. Refunds and exchanges are taken on a case-by-case basis. You may return your purchase unused and in its original packaging within 14 days upon receipt, provided you contact me about your intention within these 14 days. If the original packaging was damaged or you do not have it anymore, please provide a suitable packaging for adequate protection against damage in transit. The refund includes the original shipping cost as well as the value of the item. Your money will be refunded using the same payment method that was used at the original transaction, but you have to pay the return shipping cost. The cost of the return shipping is non-refundable. Items cannot be refunded in the event of exceeding the 14 day return policy. ",
policy_additional: "The feedbacks are very important to me. I always worry when my items are in the shipping, so it would be nice to know if they reached you. It would be also nice to know whether you liked them. Thank you! For any questions, pleas contact me by email.",
