vacation_message: "Thank you for visiting my shop. I am away on business and my store will reopen on January 26th with shipments commencing on the 27th. If you have any questions I can be reached via Etsy Convo. In the mean time feel free to visit me on Facebook at www.Facebook.com/HollowBooksByRefinedPallet Or watch some of my videos at: https://www.youtube.com/user/RefinedPallet/playlists",
