announcement: "Top Question this Month: If I order something, how quickly will it ship? Answer: Everything in my shop is made and ready to ship. Order today and your package will be in the mail by tomorrow at the latest. Order super early in the morning and it may ship the same day! DON&#39;T be a victim of package theft this holiday season! For all your online shopping, please provide a SECURE delivery address. Packages left on your doorstep could be swiped by thieves before your get home. Suggestion: Have your purchases shipped to your work address or to a locked parcel box. NEW - Live shop webcam, you never know when I may be creating something special. http://dropc.am/p/RefinedPalletShop Also feel free to visit my main shop at www.RefinedPallet.Etsy.com ..................................................................................................................................... Copyright ©2015 RefinedPallet™. All Rights Reserved. All images, photos, and content of my listings and items are not to be used without express written permission or consent.",
