policy_welcome: "My creations are born of my love for working with wood. I enjoy working with solid wood and veneers but always in a manner that produces a quality product. But of course, books are wood too!",
policy_payment: "Sales Tax is applied to all CA orders. If you purchased the item I know that you would like to start enjoying it right away. Prompt payment will help to ensure this. Once payment has been received I will ship your item right away. Payments not received within 24 hours, unless arrangements are made, will result in a cancellation of the sale.",
policy_shipping: "Shipping Policy First and foremost you must provide a “Secure” delivery address. Packages left at your door or in your mailbox are considered “Delivered”. Even if your neighborhood kids get to the package before you. I can not be responsible for your item once it shows as &quot;Delivered&quot; by the carrier. (However, carriers can make mistakes and I know this, so any issues will be handled on a case by case basis). It is also the responsibility of the buyer to provide an accurate and complete shipping address. Order and Shipping charges will not be refunded for packages sent to a customer provided address that is incorrect. Reshipments to a corrected address will be at the customer’s expense. Shipping Time – I can usually ship your purchase by the next business day. However, there will be occasions when I am not available due to business travel or vacation. In these situations I will make every effort to contact you with an estimated shipping time. (Also, I make it a point to update the shop announcements if I will be away.) USA Shipping – I usually ship via First Class Package with Delivery Confirmation 13 ounces and under. Priority with Delivery Confirmation on everything over 13 ounces and on most combined purchases. Whenever possible I will use a flat rate box. On a rare occasion I reserve the right to use UPS or FedEx when appropriate. However, I reserve the option to choose the shipping method that is most economical. (See Shipping Overcharge Refund below) International Shipping – I use First Class International on anything under 13 ounces. Over 13 ounces I use Priority International. I will use flat rate international for any large orders so please contact me before you purchase for an exact shipping price. International customers are responsible for all customs, VAT or duty charges. All knowledge of what is permitted for shipping to the destination country is the responsibility of the buyer. I will not be responsible for confiscated or “lost” items once they are in the postal system, a refund will not be issued. Shipping Overcharges Refund – I will always extend a refund for significant shipping overcharges, minus any fees paid. Refunds will come in the form of cash in the box with your item, or a refund back to your PayPal account or Etsy Direct Checkout transaction. For multiple item purchases I use Flat Rate Boxes when economically beneficial so shipping costs can be quite a bit less than what is calculated during checkout. If requested, I can quote shipping prior to your purchase. The checkout process may change in this scenario so that I can generate a corrected sale invoice. Gift Shipping – I will be happy to ship your purchase as a gift to the person of your choice. Contact me with any special request. Notes on Transit Times: Depending on what service was used to mail your item and what country you are in, delivery times can vary. With your shipping notification you should receive your tracking information for the shipment. Depending on how you paid, you may receive more than one shipping notification. (Example, one from Etsy and another from PayPal) Please note that tracking information is updated nightly with the USPS and may not be “up to the minute” during the day. If your item was shipped to a US address: (The closer you are to CA the faster it will be) Via Priority Mail – Typically delivery will occur within 2-4 business days once the post office accepts the package. First Class Parcel – Typically delivery will occur within 3-7 business days once the post office accepts the package. Parcel Post - Typically delivery will occur within 3-12 business days once the post office accepts the package. International orders take longer. Most countries will deliver the item within two week but sometimes it has been known to take eight weeks or longer. (This is a rare occurrence) If you are worried and wish to track your order, depending on the country you live in, you can use the customs form tracking number to locate the package in your countries customs clearing service or postal service provider. ",
policy_refunds: "Delivery Confirmation is there for our protection, both yours and mine. If an item is lost in the mail and can not be recovered within the carrier&#39;s specified &quot;investigation&quot; timeline I will of course offer a refund or reship a new item. High value items damaged in shipment will be refunded once I get the settlement from the carrier(when applicable) and where the buyer provides proof of the damage. I may ask that the item be returned at my expense for inspection or that the buyer provide pictures of the damaged item. However, a lot of international shipments are not insurable with any reliability, buyer assumes this risk. Otherwise I can&#39;t be responsible for product once it leaves my care and has been marked &quot;delivered&quot; buy the carrier. Returns: I will work with anyone with a reasonable request as long as the items are in new, unused, and resalable condition with all original parts, accessories and documentation. Requests for return must be made within 5 days of delivery. Returns for any reason other than damage will be at the expense of the buyer. The original shipping and any unrecoverable transaction fees will not be refunded.",
policy_additional: "I can handle wholesale requests on certain items made in my shop. Contact me with inquiries. I will entertain custom orders so feel free to contact me. I do customer work all the time. Q: Can you make a particular book thicker, thinner, wider or bigger? A: No, all of my creations are made from REAL BOOKS. I have no control over how a publisher decides to manufacture any individual book. Q: Can you create special cover artwork or title. A: No, these are made from real books converted through my process. The outside of the book is 100% original to the converted book. Q: Can you do a custom cutout, like a heart? A: Yes, I can do a custom cut out as long as I’m starting with an unaltered book, meaning that the cutout has not already been done. Contact me for any custom work and we can discuss details, option and limitations. Q: What it the thickest book available? A: I can cut books up to 2” thick. Any thicker and it will not fit under my saw for the cutting process. Q: Can I send you a book to hollow out? A: In most cases yes. Contact me for any custom work and we can discuss details, option and limitations. Q: Can you install magnetic enclosures or a lock? A: At this time, no. For a number of structural, appearance and durability reasons I don’t offer this service. Contact me for details if you would like to know more. ",
