description: "This leather journal captures the spirit of the adventurer, pure and unadulterated beauty with a single motivational phrase to spur you onward in your discoveries. Real black leather is expertly crafted to cradle high quality parchment paper ideal for writing or drawing. Embellished with your choice of inspirational phrases on a silver band you can further enhance this custom journal with burned initials. The purchase of this listing is for one leather bound journal with the following specifications: Journal Size: 4.5 by 6.25 inches (11.43 by 17.14 cm) Paper Type: Parchment Number of Pages: 200 (1 to 2 sided) Page Size: 4.25 by 5.5 inches Binding: Waxed linen stitched thread (permanent) The parchment paper is suitable for a wide variety of uses including writing, drawing, charcoal sketching, marker or even pastel based arts. A single leather wrap closure finishes this leather travel book and includes your choice of the following phrases: Possibility begins with imagination Live the life you&#39;ve imagined Encourage your hopes not your fears Reality has limits, imagination is boundless Embrace imperfection Know in your heart you are loved Capture life&#39;s moments Live in the moment The journey awakens the soul Dream as if you&#39;ll live forever No matter which variation you choose you will be treated to a truly exceptional leather book. Each leather journal is made by hand with natural, lightly distressed leather meant to age gracefully over time. The exposed stitching on the spine adds a particularly rustic flair while also ensuring appropriately bound pages. As with all handmade journals there will be natural variations in the color and texture of your black leather book and your journal will vary from the examples pictured above. If you would like to continue to shop for more leather journals, handmade books, or monogrammed sketchbooks you can return to the SchaferArtStudio shop home by clicking the following link: https://www.etsy.com/shop/SchaferArtStudio",
