description: "This large leather journal was crafted with the naturalist in mind. This leather journal is for the man (or woman) who likes to spend their time outdoors, watching the birds, sketching the trees, and documenting the world around them. Light brown leather, naturally distressed, is accented with a single real stone stitched to the cover making this leather diary as unique as the world around you. The purchase of this listing is for one leather bound journal with the following specifications: Journal Size: 6 by 9.25 inches (15 by 23 cm) Paper Type: Natural cream Number of Pages: 200 (1 to 2 sided) Page Size: 5.5 by 8.5 inches Binding: Waxed linen stitched thread (permanent) Embellishment: Stone stitched to cover The natural cream paper has a simply divine texture that lends itself to writing, drawing and sketching in a variety of mediums. Whether you are looking for a nature sketchbook, a travel journal, or simply a leather diary that will age in a way that only real leather can, this book is for you. With a soft and buttery light brown leather, a leather wrap closure, and exposed stitching on the spine this journal offers muted style and natural grace. As with all handmade journals there will be natural variations in the color and texture of your brown leather book and your journal will vary from the examples pictured above. If you would like to continue to shop for more leather journals, handmade books, or monogrammed sketchbooks you can return to the SchaferArtStudio shop home by clicking the following link: https://www.etsy.com/shop/SchaferArtStudio",
