title: "Travel Journal - Personalized Leather Journal - Handmade Bound Blank Book - Diary - monogram journal - Leather Writing Notebook -Sketchbook",
description: "Navy Blue Hand Bound Blank Journal •	Leather & Design- Navy Blue Leather •	Size- Large Journal measures 4 1/2&quot; X 6 1/4&quot; (11.43 cm X 17.14 cm) • Paper Type – parchment (writing, drawing, ink, charcoal, marker, colored pencil, pastel) •	Number of Pages -200-1 to 2 sided •	Page size- 4 1/4&quot; X 5 1/2&quot; •	You Pick - Silver Band stitched to cover •	leather wrap closure •	Permanently Bound with Waxed Linen stitched thread Silver Band Words You will select the Silver Band Word you want after you place in your cart under Variations: The choices are possibility begins with imagination live the live you&#39;ve imagined encourage your hopes not your fears reality has limits, imagination is boundless embrace imperfection know in your heart you are loved capture life&#39;s moments live in the moment the journey awakens the soul dream as if you&#39;ll live forever For someone who enjoys writing or drawing there is no gift more appreciated than a fine journal. Each journal is one of a kind. It makes an excellent gift for yourself or for the writer and artist in your life. You will enjoy the soft buttery feel of the leather and it will last for years to come. My leather wrap journals are made entirely by hand. Exposed stiches along the spine add a design element while also tightly securing the pages. All of the leather is natural, lightly distressed, and is meant to age with you, acquiring the patina with frequent use. Variations in color and texture of the leather are part of the unique quality and aesthetic of this handcrafted journal. Each journal is unique, should be used often, and is made to last. This would make a lovely gift. I can mail it wrapped beautifully to the intended person with a gift tag from you. Just leave a note at check out or convo me if this is a gift. To see all of my items click here: https://www.etsy.com/shop/SchaferArtStudio?ref=hdr_shop_menu",
