title: "Leather Journal, Sketchbook, Hand Bound Blank Book, Purple Leather,Sculpted Relief, Painted Edges, Gilding, Gift For Her",
description: "Purple leather journal with blank pages is sewn in ancient binding, with hand-tooled medieval motif gilded on the cover. Watercolor painting made on sanded edges of the block of the book for brighter accent. The journal has watercolor painted end papers. The size of the journal is 4.75&quot; x 5.75&quot; x 1.25&quot; (12 x 15 x 3 cm) with 160 sheets (320 pages) of 100 g/sq.m white paper. This purple leather journal combines potentialities of several bookbinding styles. It is sewn in full leather case binding with sculpted raised spine and hardcover, that gives the book stability and profoundness. Long-stitch-binding-look is used to close the book - bottom cover fly is folded over the upper cover and fastened with leather strap to show the beauty of the leather itself. There is a medieval motif sculpted in leather with hand-tooled stamping and gilding on the cover. The block of the book has sanded edges painted with watercolors for brighter accent. The journal will be made within 4 weeks time frame and will be shipped by priority mail service. For specific dates please contact me before ordering. For other journal options, please, have a look at - https://www.etsy.com/shop/Leatherdust?section_id=11847102, or here - https://www.etsy.com/shop/Leatherdust?section_id=12569643. Like leather art? Please visit my shop to see more interesting pieces of leather artwork - https://www.etsy.com/shop/Leatherdust?ref=si_shop",
