policy_welcome: "Hello, dear! Thanks for visiting my shop! Hope you&#39;ll find what you are looking for! Every single item is a piece of artwork and may differ a bit in comparison to the picture; not everything displayed is available at the moment, but allow me 3 to 5 weeks for production and shipping, and you&#39;ll get a real masterpiece of art! For any details, please, do not hesitate to contact me by e-mail at daigasdarbnica@gmail.com, answer guaranteed!",
